import '../styles/Dropdown.css'

function Dropdown({title, details}){
    return (
        <div className="dropdown">
            <h3 className="dropdown__title">
                {title}
            </h3>
            <p className="dropdown__details">
                {details}
            </p>
        </div>
    )
}

export default Dropdown
